@CanRTE16 Üçbeş kendini bilmez yüzünden değişen değişsin.

 Bir çoğu zaten chp li falan değil oylar kaysın diye bakıyo olan yobazcılardan.
 O bölgede davul zurna çalıp göbek atanın bir çoğu arap bedevisi ve suriyeli sanmıyorum ki yerli halktan acısı varken göbek atacağını. Olsada çok azdır

